import React from 'react';
import './Filter.css';

const Filter = () => {
  return (
    <div className="filter">
      <button>Filter by Date</button>
      <button>Filter by Type</button>
      <input type="text" placeholder="Search retreats by title" />
    </div>
  );
};

export default Filter;
